import { Box, Text, Flex, Divider } from "@chakra-ui/react";

const CartPageData = () => {
  return (
    <>
      <CartPageInitialComponent />
      <Box>
        <CartPageSecondryComponent />
      </Box>
    </>
  );
};

export default CartPageData;

const CartPageInitialComponent = () => {
  return (
    <>
      <Box
        display={"flex"}
        alignItems="center"
        justifyContent={"center"}
        padding={"1vmax"}
      >
        <Text fontSize={"5xl"} fontWeight={"bold"}>
          Cart Items
        </Text>
      </Box>
    </>
  );
};

const CartPageSecondryComponent = () => {
  return (
    <>
      <Flex w={"100vw"} gap={"1rem"}>
        <CartItems />
        <Divider orientation="vertical" h="100px" />
        <CartPaymentPage />
      </Flex>
    </>
  );
};

const CartItems = () => {
  return (
    <Box border="1px solid" w={"60vw"}>
      hello
    </Box>
  );
};

const CartPaymentPage = () => {
  return (
    <>
      <Box w={"40vw"} border="1px solid">
        hello
      </Box>
    </>
  );
};
